import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Signup.css";

export default function SignupPage() {
    const [errorMessage, setErrorMessage] = useState("");
    const [fullName, setFullName] = useState("");
    const [email, setEmail] = useState("");
    const [mobile, setMobile] = useState("");
    const [dateOfBirth, setDateOfBirth] = useState(""); // Correct field name
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");
    const navigate = useNavigate();

    const handleSignupSuccess = (event) => {
        event.preventDefault();
        setErrorMessage("");

        if (!fullName || !email || !mobile || !dateOfBirth || !password || !confirmPassword) {
            setErrorMessage("All fields are required!");
            return;
        }

        if (!/^[a-zA-Z]+(?: [a-zA-Z]+)*$/.test(fullName)) {
            setErrorMessage("Please enter a valid name!");
            return;
        }

        if (!/^[6-9][0-9]{9}$/.test(mobile)) {
            setErrorMessage("Please enter a valid mobile number!");
            return;
        }

        if (!/^([a-zA-Z0-9]+)@([a-zA-Z0-9]+)\.([a-zA-Z]{2,})(\.[a-zA-Z]{2,})?$/.test(email)) {
            setErrorMessage("Please enter a valid email!");
            return;
        }

        if (!/^(?=.*[0-9])(?=.*[a-z])(?=.*[A-Z])(?=.*[@#\$])[A-Za-z0-9@#\$]{6,12}$/.test(password)) {
            setErrorMessage(
                "Password must be 6-12 characters, with at least one digit, one lowercase letter, one uppercase letter, and one special character (@, #, $)"
            );
            return;
        }

        if (password !== confirmPassword) {
            setErrorMessage("Passwords do not match!");
            return;
        }

        const datas = {
            name: fullName,
            email: email,
            mobile: mobile, // Correct key
            dateOfBirth: dateOfBirth, // Correct key
            password: password,
        };

        console.log("Data being sent to server:", datas);

        fetch("http://localhost:8085/api/farmers/addUser", {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(datas),
            credentials: "same-origin",
        })
            .then((response) => {
                console.log('Response received:', response);
                if (response.status === 409) {
                    return response.text().then((text) => {
                        throw new Error(text || "User already exists! MobileNo or Email");
                    });
                }
                if (!response.ok) {
                    throw new Error(`Server error: ${response.status}`);
                }
                return response.json();
            })
            .then((data) => {
                console.log("User added:", data);
                alert("User added successfully!");
                navigate("/logins");
            })
            .catch((error) => {
                console.error("Error:", error);
                setErrorMessage(error.message);
            });
    };

    return (
        <>
            <div className="signup-wrapper">
                <div className="signup-card">
                    <Link to="/loginc" className="signup-link">
                        Back
                    </Link>
                    <br />
                    <h2 className="signup-header">Create an Account</h2>
                    <form className="signup-form" onSubmit={handleSignupSuccess}>
                        {errorMessage && <p className="signup-error-message">{errorMessage}</p>}
                        <input
                            className="signup-input-field"
                            type="text"
                            placeholder="Full Name"
                            value={fullName}
                            onChange={(e) => setFullName(e.target.value)}
                            required
                        />
                        <input
                            className="signup-input-field"
                            type="email"
                            placeholder="Email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            required
                        />
                        <input
                            className="signup-input-field"
                            type="tel"
                            placeholder="Mobile Number"
                            value={mobile}
                            onChange={(e) => setMobile(e.target.value)}
                            required
                        />
                        <input
                            className="signup-input-field"
                            type="date"  // Keep as "date"
                            value={dateOfBirth}  // Use dateOfBirth state
                            onChange={(e) => setDateOfBirth(e.target.value)} // Update dateOfBirth state
                            required
                        />
                        <input
                            className="signup-input-field"
                            type="password"
                            placeholder="Password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                        <input
                            className="signup-input-field"
                            type="password"
                            placeholder="Confirm Password"
                            value={confirmPassword}
                            onChange={(e) => setConfirmPassword(e.target.value)}
                            required
                        />
                        <button type="submit" className="signup-btn">
                            Sign Up
                        </button>
                    </form>
                    <div className="signup-footer">
                        <p>
                            Already have an account?{" "}
                            <Link to="/logins" className="signup-link">
                                Sign In
                            </Link>
                        </p>
                    </div>
                </div>
            </div>
        </>
    );
}
